```sparql
# Find wars associated with Beauchamp Seymour, 1st Baron Alcester
SELECT ?beauchampWar WHERE {
  <http://dbpedia.org/resource/Beauchamp_Seymour,_1st_Baron_Alcester> <http://dbpedia.org/ontology/war> ?beauchampWar .
}

# Find the leader of the 1962 New South Wales state election and their birthplace country
SELECT ?leader ?birthCountry WHERE {
  ?election <http://dbpedia.org/property/electionLeader> ?leader .
  ?leader <http://dbpedia.org/ontology/birthPlace> ?birthLocation .
  ?birthLocation <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/ontology/Country> .
  FILTER(?election = <http://dbpedia.org/resource/1962_New_South_Wales_state_election>)
}

# Find the military unit associated with Heather Roy
SELECT ?heatherUnit WHERE {
  <http://dbpedia.org/resource/Heather_Roy> <http://dbpedia.org/ontology/profession> ?unit .
  FILTER(?unit <http://dbpedia.org/ontology/MilitaryUnit>)
}

# Combine to find common wars
SELECT DISTINCT ?commonWar WHERE {
  # Beauchamp Seymour's war
  { SELECT ?beauchampWar WHERE {
      <http://dbpedia.org/resource/Beauchamp_Seymour,_1st_Baron_Alcester> <http://dbpedia.org/ontology/war> ?beauchampWar .
    }
  } AS %beauchampWars

  # Leader's country war
  { SELECT ?countryWar WHERE {
      ?leader <http://dbpedia.org/property/birthPlace> ?birthLocation .
      ?birthLocation <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/ontology/Country> .
      ?country <http://dbpedia.org/ontology/war> ?countryWar .
      FILTER(?leader = ?electionLeader)
    }
  } AS %countryWars

  # Heather Roy's unit war
  { SELECT ?unitWar WHERE {
      ?heatherUnit <http://dbpedia.org/ontology/profession> ?unit .
      ?unit <http://dbpedia.org/ontology/war> ?unitWar .
      FILTER(?unit = ?heatherProf)
    }
  } AS %unitWars

  # Find common wars
  VALUES ?commonWar {
    { SELECT ?beauchampWar WHERE { %beauchampWars }}
    UNION
    { SELECT ?countryWar WHERE { %countryWars }}
    UNION
    { SELECT ?unitWar WHERE { %unitWars }}
  }
}
```

