```sparql
SELECT ?parent WHERE {
  # Step 1: Identify Antiochus (son of Antiochus III the Great)
  ?antiochus dbpedia-owl:childOf <http://dbpedia.org/resource/Antiochus_III_the_Great> .

  # Step 2: Find his child who is royalty
  ?child dbpedia-owl:parent ?antiochus ;
         a dbo:Royalty .

  # Step 3: Identify successor of Antiochus II Theos who is royalty
  ?successor dbpedia-owl:succeededBy <http://dbpedia.org/resource/Antiochus_II_theos> ;
             a dbo:Royalty .

  # Step 4: Find spouse of Laodice IV, ensuring they are royalty
  ?spouse dbpedia-owl:spouse <http://dbpedia.org/resource/Laodice_IV> ;
          a dbo:Royalty .

  # Step 5: Child of child (royalty) from successor and spouse
  ?grandchild dbpedia-owl:parent ?successor, ?spouse ;
              a dbo:Royalty .

  ?greatGrandchild dbpedia-owl:parent ?grandchild ;
                   a dbo:Royalty .

  # Step 6: Parent of Antiochus' child
  ?parent dbpedia-owl:parent ?child .
}
```

