    ?location <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/ontology/Settlement> .
    BIND(?location AS ?settlement)
  }

  OPTIONAL {
    ?adminLocation <http://dbpedia.org/ontology/administrativeRegion> ?region .
    FILTER (?adminLocation = ?location)
    ?region <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/ontology/Region> .
    ?region <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/ontology/State> .
  }

  FILTER EXISTS { ?settlement <http://www.w3.org/2000/01/rdf-schema#label> ?labelSettlement . FILTER(lang(?labelSettlement) = "en") }
  FILTER EXISTS { ?region <http://www.w3.org/2000/01/rdf-schema#label> ?labelRegion . FILTER(lang(?labelRegion) = "en") }
}
```

